import Head from 'next/head';

import { Button, Container, Jumbotron } from 'reactstrap';

function Home() {
  return (
    <>
      <Head>
        <title>Hello World</title>
        <meta name="description" content="Site de Elton Santos sobre Semana Imersão React" />
        <meta name="author" content="Elton Santos" />
      </Head>

      <Jumbotron>.
        <Container>
          <h1>Título</h1>
        </Container>
      </Jumbotron>

      <Button color="success">Success</Button>
    </>
  );
};

export default Home;
